import React from 'react';
import Login from './htmlfiles/Login';
import Register from './htmlfiles/Register';
import Buttons from './htmlfiles/Buttons';
import Change from './htmlfiles/Change';
import style from'./cssfile/Register.css';
import {BrowserRouter as Router, Route} from 'react-router-dom';
function App() {
  return (
    <div>
    <Router>
      <Route path="/"exact strict component={Login}/>
      <Route path="/Register" ref={style.content} exact component={Register}/>
      <Route path ="Buttons" exact component={Buttons}/>
      <Route path ="Change" exact component={Change}/>
    </Router>
    </div>
  );
}

export default App;
